import{_ as t,c as e,o,a}from"./app.7cc72068.js";const _=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[{"level":2,"title":"command line outputs","slug":"command-line-outputs","link":"#command-line-outputs","children":[]},{"level":2,"title":"file outputs","slug":"file-outputs","link":"#file-outputs","children":[]}],"relativePath":"twitter/usage/outputs.md","lastUpdated":1686843586000}'),i={name:"twitter/usage/outputs.md"},s=a('<p>#outputs</p><h2 id="command-line-outputs" tabindex="-1">command line outputs <a class="header-anchor" href="#command-line-outputs" aria-hidden="true">#</a></h2><p>scraping is run in <code>batches</code>.</p><p>After each batch has run, the command line will output the number of retrieved tweets in that <code>batch</code> (max 110), then a tallied total in brackets. <strong>Ordinarily, the total is what you would be interested in.</strong></p><p>Once the scrape is concluded, the command line will output <code>[\u{1F438}/twitter-scraper]: Search completed. [\u{1F438}/twitter-scraper]: Terminating.</code></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>If console outputs <code>[\u{1F438}/tscrape]: Error 404 - No tweets found.</code> the <a href="https://sf-designdev-packages.github.io/twitter/usage/quotas-and-limitations.html" target="_blank" rel="noreferrer">quota</a> has likely been maxed out</p></div><h2 id="file-outputs" tabindex="-1">file outputs <a class="header-anchor" href="#file-outputs" aria-hidden="true">#</a></h2><p>All the scraped tweets will be out put in a JSON file, named <code>tweets-[id].json</code> E.g tweets-1686668275417.json</p><p>Each tweet object will contain:</p><ol><li>The date/time of the tweet</li><li>Tweet edit history ids</li><li>The tweet id,</li><li>the content/text of the tweet</li></ol><p><strong>E.g</strong> :::JS { &quot;created_at&quot;: &quot;2023-06-13T14:54:16.000Z&quot;, &quot;edit_history_tweet_ids&quot;: [&quot;1668632887586062342&quot;], &quot;id&quot;: &quot;1668632887586062342&quot;, &quot;text&quot;: &quot;@nyxiesnook @bloggernation @LifestyleBlogzz I&#39;m returning all comments on my latest post: <a href="https://t.co/CYSxiGzbtb" target="_blank" rel="noreferrer">https://t.co/CYSxiGzbtb</a> \u{1F9E1}&quot; } :::</p>',11),n=[s];function l(r,u,c,d,p,h){return o(),e("div",null,n)}const f=t(i,[["render",l]]);export{_ as __pageData,f as default};
